INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0690G', '330100', '120.20771,30.272746;120.208426,30.272902;120.208957,30.273055;120.208944,30.273817;120.209949,30.273802;120.209948,30.273619;120.210028,30.273624;120.210024,30.273069;120.210006,30.272873;120.209927,30.272874;120.20991,30.272526;120.209906,30.272179;120.210661,30.272174;120.210708,30.27054;120.20797,30.270571;120.207872,30.270583;120.207771,30.27064;120.207747,30.270721;120.207742,30.270819;120.207708,30.27173;120.20771,30.272746', '景华苑(景华路)', '杭州市江干区昙花庵路190号', '杭州市', '', '66738.869988', '120.209167,30.271881', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '景芳六区位于江干区新塘路272号,房子是景芳一代中房龄较新的,景芳地处杭州的老城区,地理位置优越、交通便利、环境优雅,小区出门就是公交起点站,地铁和超市小区5路程能到达。  景芳六区是质量较高、配套完善的住宅小区。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。园区倡导一种快节奏、低生活成本、高娱乐的都市人生活方式。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0690I', '330100', '120.15118,30.184828;120.150942,30.184931;120.150818,30.185092;120.149684,30.18577;120.148606,30.186423;120.148518,30.186584;120.148742,30.187035;120.149104,30.187781;120.149668,30.187541;120.149777,30.187481;120.149875,30.187389;120.150354,30.187085;120.150496,30.186838;120.150541,30.186862;120.150777,30.186445;120.150962,30.186379;120.151802,30.18626;120.151318,30.185143;120.15118,30.184828', '景江苑', '杭州市滨江区江南大道4348号', '杭州市', '', '39771.413917', '120.150103,30.186329', '商务住宅;住宅区;住宅小区', '', '1.69', '', '32910', '之江公寓·景江苑位于钱塘江一桥南岸,与六和塔隔江相望,南临江南大道,西靠西环线,紧临之江度假村,由9幢十至十九层的高层、小高层电梯公寓、一幢二层的休闲中心呈围合状有机组合而成。社区的中庭景观,聘请环境设计大师——香港贝尔高林公司倾力打造,是一座充满生态魅力的现代家园。  之江公寓·景江苑充分体现了“以人为本”的开发理念,在优越的地理环境中,创造一个富有现代气息、品位高雅的生活栖息地,极具创造性地将独门独户的私有庭院引入到高层住宅中,形成真正的空中别墅生态景观,使人足不出户就能接触自然,为业主带来更加完美的生活空间,满足业主回归自然的需求。  景江苑的中庭设计由贝尔高林倾力打造、溪流、广场、绿草、草木与住宅建筑相辅相成,建筑采用点式的布局,景观设计上以均好性为特色,并将建筑与自然,自然与人文完美地融合在一起。参照的生活蓝本进行规划设计,自然起伏的坡地,蜿蜒的鹅卵石小径,涓涓的细流,喷涌的泉水,艺术的雕塑、巧夺天工的假山,娇艳的花朵,碧绿的小草,所有美丽的景观都在融汇,让你每天都能享受美妙的景致。极具特色的景观小品,有着很高的艺术价值,让您的生活中充满了艺术的浪漫气息。', '2004-05-30', '1.6元/月/平方米');
