INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06D8Z', '330100', '120.177174,30.23669;120.177619,30.237376;120.177919,30.23786;120.17831,30.23768;120.178625,30.237521;120.178298,30.237002;120.177938,30.236444;120.177875,30.236351;120.177174,30.23669', '陆家河头小区', '杭州市上城区江城路636-2号', '杭州市', '', '9816.593086', '120.177902,30.237106', '商务住宅;住宅区;住宅小区', '', '20', '450平方米', '33725', '陆家河头小区属于老小区,交通便利,户型好,结构正气,周边的配套设施都齐全,但面积比较小,绿化和物业不是很好。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06DB9', '330100', '120.267483,30.202625;120.265993,30.202763;120.266291,30.204424;120.266338,30.204469;120.266401,30.204479;120.267717,30.204429;120.267805,30.204345;120.267679,30.203497;120.267796,30.203474;120.267647,30.202653;120.267483,30.202625', '绿都百瑞广场', '杭州市萧山区市心北路199号', '杭州市', '', '25662.272368', '120.266943,30.20355', '商务住宅;住宅区;住宅小区', '', '3.57', '110000平方米', '11992', '绿都百瑞广场,在“构筑大都市,建设新天堂”的城市发展背景下,依托“钱江时代新杭州”的大都市发展概念,以潜力无限的区位优势,完备的生活配套,环境舒适的居住模式,积极推动新杭州未来人居的进程。一江奔腾,两岸同城。随着“东动、西静、南新、北秀、中兴”的大都市规划格局的提出,钱江世纪城控制性规划的正式通过,萧山作为城市发展的重心所在,正以一个全新的姿态,迎接这前所未有的发展契机,已经成为“杭州的浦东”。钱江三桥过桥费的取消,钱塘江地下隧道的开通,钱江世纪城建设的全面启动,钱江南岸的区位价值日益凸现,绿都·百瑞广场正以其不可限量的增殖魅力向我们走来。这是一块让人充满幻想的土地,一个属于有梦者的天堂,她强大的财富吸附力,源自于她占据的大杭州国际化变更的中心位置,源自于她日趋完善的投资环境以及优厚开明的投资政策,更源自于向她潮涌而来的有国际视眼的志士。绿都百瑞广场,紧邻杭州未来CBD区块钱江世纪城,位于58米宽迎宾大道市心路,24米宽景观大道建设三路之汇合点,西邻宁安河,是一个全新崛起的国际化商务生活圈,一处视眼开阔的洁净之地,唯有品位超然者居之!已推出楼盘售罄,两幢楼未公开。项目特点投资价值高,堪称钱江世纪城原始股,处杭州未来的核心区域;百瑞广场以准现房形式销售,体现了绿都房产诚信的态度;绿都房产用材讲究,设计新颖,权利打造钱江南岸名流生活的典范。', '2003-11-08', '3.9元/月/平方米');
