INSERT INTO "public"."gaode_residential_region" VALUES ('B023B072W6', '330100', '120.091157,30.273554;120.091114,30.273567;120.090557,30.273458;120.091184,30.270825;120.091618,30.270853;120.091738,30.27075;120.091897,30.270109;120.0923,30.268964;120.093433,30.26914;120.093375,30.269728;120.094129,30.270147;120.09399,30.270613;120.094414,30.270698;120.094709,30.270858;120.093764,30.272294;120.092348,30.272173;120.092088,30.273114;120.091366,30.273028;120.091157,30.273554', '紫金庭园', '杭州市西湖区紫荆花路9号', '杭州市', '', '84669.397495', '120.092531,30.271224', '商务住宅;住宅区;住宅小区', '', 'None', '', '38658', '紫金庭园位于目前杭城大型的居住区——城西蒋村住宅区,北依文三路延伸段文苑路,东贴紫金港河,西接规划中的紫金大道和西溪旅游文化风景区,尽享都市繁华和西溪自然美景。园区总占地近148亩,总建筑面积约15万平方米,规划建造叠层排屋、多层城市公寓、多层高尚电梯公寓、小高层景观公寓共1000余户尊贵居所,容积率1.6,绿化率35%以上,园区配备豪华独立会所,精品购物街,游泳池和网球场等现代高尚配套设施,是一个满足现代都市人高品位生活需求的精品住宅。西溪.紫金庭园是杭城“低层低密度”楼盘的典型代表。交通结构采用人车分流的理念,建筑立面追求一种典雅、稳重的建筑形象,户型上讲究“四明”(明厨、明卫、明厅、明卧)西溪.紫金庭园依托蒋村商住区成熟的市政配套,与规划中的西城广场仅一站距离,学校、超市、银行、电影院、精品店等日常生活配套一应俱全,园区西侧是著名的西溪风景区、西溪.紫金庭园建筑典雅,景观优美,兼具都市繁华和西溪美景,体现人类渴望自然,热爱都市的心理追求,是现代人理想生活的经典表征。', '', '0.9-1.85元/月/平方米');
