INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07Z6D', '330100', '120.164381,30.305289;120.163921,30.305214;120.163834,30.306023;120.164308,30.306195;120.166555,30.306628;120.166793,30.305595;120.165997,30.305509;120.165097,30.305393;120.164969,30.305381;120.164652,30.305342;120.164489,30.305311;120.164381,30.305289', '三塘南村', '杭州市下城区香积寺路139号', '杭州市', '', '24548.567969', '120.165324,30.305895', '商务住宅;住宅区;住宅小区', '', 'None', '', '28418', '三塘南村位于香积寺路白石巷交叉口,小区规划好,整齐,年代较新,街道商店林立,以服装与餐饮为主,交通便利,出门走5就是公交站台,到市中心公交车较多,附近有大型沃尔玛超市,马路对面就是好来登大酒店。  小区环境舒适,闹中取静,绿化率高,生活配套成熟,餐饮、超市、银行、学校、医院、公交站点近在咫尺,生活非常方便,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.35元/月/平方米');
