INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0937U', '330100', '120.168528,30.247653;120.168533,30.247542;120.168256,30.247532;120.166535,30.247597;120.166511,30.247652;120.166508,30.249162;120.168377,30.249168;120.168472,30.24865;120.168534,30.2483;120.168539,30.247829;120.168528,30.247653', '青年路小区(青年路)', '杭州市上城区国货路7号', '杭州市', '', '28940.655818', '120.16751,30.248352', '商务住宅;住宅区;住宅小区', '', '2.6', '', '35345', '上城区 西湖边成熟老小区 户型分别有 一室 / 二室 / 三室 都有.主力户型以二室为主.小区内停车方便 绿化好  周围生活配套设施齐全 离购物天堂 银泰 / 解百 / 家乐福 等仅5路程。紧邻未来的中山中路步行街和公园,潜力巨大,地段好,交通方便,脚踏四方。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JHM', '330100', '120.277297,30.163404;120.275748,30.163343;120.27572,30.163389;120.275718,30.163438;120.275704,30.164215;120.275733,30.164987;120.277223,30.164884;120.277217,30.164411;120.277244,30.164393;120.277266,30.164362;120.277273,30.164337;120.27729,30.164217;120.277293,30.163482;120.277297,30.163404', '众安花园', '杭州市萧山区萧然东路41号', '杭州市', '', '22050.986687', '120.276477,30.164145', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '众安花园坐落于萧山区萧绍路与萧然东路交叉口,交通非常便捷,独特的建筑群外观与周围的老式建筑形成强烈的对比,醒然夺目,外闹内静,建筑布局井然有序,为业主营造一个安居、舒适的生活空间。小区由10幢多层住宅和1幢小高层综合办公楼构成,总建筑面积30559㎡,占地18480㎡,绿地面积约5500㎡。主入口设在萧然东路,两侧沿街面,以两层店面形成整体连接,为小区内居民提供配套服务。 ; 小区设计围绕“以人为本”这个主题,创造平等、自由、和谐、健康的生活空间,体现互为、高服务化的安全保障感。区内中、低乔木与', '', '');
