INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC2N', '330100', '120.165295,30.189559;120.165229,30.189438;120.165109,30.189244;120.164285,30.18898;120.164218,30.18915;120.164122,30.189479;120.164014,30.189867;120.163856,30.190427;120.163795,30.190553;120.163679,30.190678;120.163283,30.191094;120.162894,30.191455;120.162695,30.191684;120.162392,30.191797;120.162365,30.192106;120.16229,30.192682;120.164082,30.193283;120.164208,30.193308;120.16432,30.193259;120.164382,30.193122;120.164977,30.191074;120.165314,30.189737;120.165295,30.189559', '盛元慧谷', '杭州市滨江区火炬大道725号', '杭州市', '', '60810.806669', '120.163976,30.191371', '商务住宅;住宅区;住宅小区', '1300', '3.5', '252874平方米', '27738', '盛元慧谷由杭州盛元房地产开发有限公司投资并开发,位于杭州钱塘江南岸滨江区之江科技工业园25号地块内,东临火炬大道,南临滨盛路,西面接壤国信嘉园,北面接壤70米深的城市绿化带,并直临闻涛路与钱塘江,用地面积52341平米,土地使用性质为商住用地,容积率小于3.5,建筑密度小于20%,绿化率大于40%,日照间距大于1:1.17。建筑退红线分别为:东退火炬大道多层20米以上、高层30米以上,南退滨盛路多层20米以上、高层30米以上,西退用地红线8米以上,北退用地红线3米以上。', '2007-04-28', '1.5元/月/平方米');
