INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3BXYF', '330100', '120.05678,30.253838;120.056807,30.253732;120.055875,30.253444;120.054978,30.253134;120.055584,30.251783;120.05768,30.252605;120.058846,30.253064;120.05832,30.254315;120.057886,30.254292;120.05678,30.253838', '西溪名园', '杭州市余杭区天目山路518号西溪国家湿地公园', '杭州市', '', '46441.745092', '120.056928,30.25309', '商务住宅;住宅区;住宅小区', '261', 'None', '36000平方米', '24274', '西溪名园座落在西溪湿地里面,环境优美,湿地文化浓郁,四周环水,是杭州仅有的一座湿地公园小区。西溪名园占地面积53000平方米,容积率仅0.69,绿化率达40%,建筑充满着西班牙风格。西溪名园位于未来西大门,连接湿地公园三期寿堤;寿堤全长5470米,宽4.5米,是西溪湿地长、美的堤。漫步长堤,湿地风光尽收眼底;寿堤之“寿”,意在健康长寿。未来西大门对面将是西溪大众休息村。西溪大众休息村沿东面的建筑是20年租期的湿地商业配套,根据了解将会招商如:两岸咖啡、星巴克等餐饮配套。', '2004-09-30', '2.8元/月/平方米');
